import React from 'react';

const mapper = function(mechanic) {

    return (
        <>
                 
                                <div className="row g-5">
                                    <div className="col-md-12">
                                        <label  className="form-label">Nom: </label>
                                        <input type="text" className="form-control" aria-describedby="emailHelp" value={mechanic.nom} onChange ={(event)=>this.nameInputChange(event)}></input>
                                        {/* <div id="emailHelp" className="form-text">We'll never share your email with anyone else.</div> */}
                                    </div>

                                    <div className="col-md-12">
                                        <label  className="form-label">Pr√©nom: </label>
                                        <input type="text" className="form-control"  value={mechanic.prenom} onChange ={(event)=>this.adresseInputChange(event)}></input>
                                    </div>

                                    <div className="col-md-12">
                                        <label  className="form-label">Adresse e-mail: </label>
                                        <input type="text" className="form-control" value={mechanic.adressemail} onChange ={(event)=>this.phoneNumberInputChange(event)}></input>
                                    </div>

                                    <div className="col-md-12">
                                        <label  className="form-label">garage: </label>
                                        <input type="text" className="form-control" value={mechanic.garage_fk} onChange ={(event)=>this.phoneNumberInputChange(event)}></input>
                                    </div>
                                </div>

                            
        </>
    );
};

export default mapper;
